import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function Workouts() {
  const [workouts, setWorkouts] = useState([]);
  const [form, setForm] = useState({ exercise: '', reps: '', sets: '', weight: '', date: '' });
  const [editingId, setEditingId] = useState(null);

  useEffect(() => {
    fetchWorkouts();
  }, []);

  const fetchWorkouts = () => {
    axios.get('http://localhost:5000/workouts')
      .then(res => setWorkouts(res.data))
      .catch(err => console.error('Fetch error:', err));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const request = editingId
      ? axios.put(`http://localhost:5000/workouts/${editingId}`, form)
      : axios.post('http://localhost:5000/workouts', form);

    request
      .then(() => {
        setForm({ exercise: '', reps: '', sets: '', weight: '', date: '' });
        setEditingId(null);
        fetchWorkouts();
      })
      .catch(err => console.error('Submit error:', err));
  };

  const handleEdit = (workout) => {
    setForm(workout);
    setEditingId(workout._id);
  };

  const handleDelete = (id) => {
    axios.delete(`http://localhost:5000/workouts/${id}`)
      .then(fetchWorkouts)
      .catch(err => console.error('Delete error:', err));
  };

  return (
    <div className="max-w-3xl mx-auto p-6">
      <h2 className="text-3xl font-bold mb-6 text-center">Workout Log</h2>
      <form onSubmit={handleSubmit} className="grid gap-4 mb-8 bg-gray-100 p-6 rounded-lg shadow">
        <input
          type="text"
          placeholder="Exercise"
          value={form.exercise}
          onChange={e => setForm({ ...form, exercise: e.target.value })}
          className="p-2 rounded border"
          required
        />
        <input
          type="number"
          placeholder="Reps"
          value={form.reps}
          onChange={e => setForm({ ...form, reps: e.target.value })}
          className="p-2 rounded border"
          required
        />
        <input
          type="number"
          placeholder="Sets"
          value={form.sets}
          onChange={e => setForm({ ...form, sets: e.target.value })}
          className="p-2 rounded border"
          required
        />
        <input
          type="number"
          placeholder="Weight (kg)"
          value={form.weight}
          onChange={e => setForm({ ...form, weight: e.target.value })}
          className="p-2 rounded border"
          required
        />
        <input
          type="date"
          value={form.date}
          onChange={e => setForm({ ...form, date: e.target.value })}
          className="p-2 rounded border"
          required
        />
        <button type="submit" className="bg-green-600 text-white py-2 rounded hover:bg-green-700">
          {editingId ? 'Update Workout' : 'Add Workout'}
        </button>
      </form>

      <div className="space-y-4">
        {workouts.map(workout => (
          <div key={workout._id} className="bg-white p-4 rounded shadow border">
            <div className="flex justify-between items-center">
              <div>
                <h3 className="text-lg font-semibold">{workout.exercise}</h3>
                <p className="text-gray-600">{workout.sets} sets x {workout.reps} reps @ {workout.weight} kg</p>
                <p className="text-sm text-gray-500">Date: {workout.date}</p>
              </div>
              <div className="space-x-2">
                <button
                  onClick={() => handleEdit(workout)}
                  className="bg-yellow-500 text-white px-3 py-1 rounded hover:bg-yellow-600"
                >
                  Edit
                </button>
                <button
                  onClick={() => handleDelete(workout._id)}
                  className="bg-red-600 text-white px-3 py-1 rounded hover:bg-red-700"
                >
                  Delete
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
